**Describe the bug**
Implement [ONNX Flatten](https://github.com/onnx/onnx/blob/master/docs/Operators.md#Flatten) to support `torch.flatten`.
Unfortunately ONNX flatten is a little too specialized though

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Ubuntu 16
- ONNX Runtime installed from (source or binary): pip
- ONNX Runtime version: 0.4.0
- Python version: 2

**To Reproduce**
Export this `nn.Module`

```python
class Reduction(nn.Module):
    def __init__(self, operation='+', axis=None):
        super(Reduction, self).__init__()
        self.operation = operation
        self.axis = axis or 0  # default initial axis to reduce

    def extra_repr(self):
        """Extra information
        """
        return "{}{}".format(
                self.operation,
                ", axis={}".format(self.axis) if self.axis else "",
        )

    def forward(self, x):
        axis = self.axis
        if self.axis == 0 and x.size(0) == 1:
            # full reduction on a single batch
            axis = None
        if self.operation == '+' or self.operation == 'SUM':
            if axis is None:
                return x.sum()
            return x.flatten(axis).sum(axis)
        elif self.operation == 'ASUM':
            if axis is None:
                return x.abs().sum()
            return x.abs().flatten(axis).sum(axis)
        elif self.operation == 'SUMSQ':
            if axis is None:
                return x.pow(2).sum()
            return x.pow(2).flatten(axis).sum(axis)
        elif self.operation == 'MEAN':
            if axis is None:
                return x.mean()
            return x.flatten(axis).mean(axis)
        else:
            raise RuntimeError('forward Reduction, unknown operator: {}'.format(self.operation))
```

**Expected behavior**
Support ONNX Flatten

**Additional context**
PyTorch's flatten is very generic, it has `start_dim` and `end_dim`:

```python
flatten(input, start_dim=0, end_dim=-1) -> Tensor

Flattens a contiguous range of dims in a tensor.

Args:
    input (Tensor): the input tensor
    start_dim (int): the first dim to flatten
    end_dim (int): the last dim to flatten

Example::

    >>> t = torch.tensor([[[1, 2],
                           [3, 4]],
                          [[5, 6],
                           [7, 8]]])
    >>> torch.flatten(t)
    tensor([1, 2, 3, 4, 5, 6, 7, 8])
    >>> torch.flatten(t, start_dim=1)
    tensor([[1, 2, 3, 4],
            [5, 6, 7, 8]])
Type:      builtin_function_or_method
```

